import React from 'react';
import './Entry.css';
import 'bootstrap/dist/css/bootstrap.css';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import {faCogs, faPlay} from '@fortawesome/free-solid-svg-icons';
import {Link} from 'react-router-dom';

export const Entry = (): JSX.Element => {
    return (
        <div className={'entry'}>
            <div className={'game_name'}>
                alsdkfjhn
            </div>
            <div className={'fst_choice'}>
                <Link to="/levelPage/Aristotes/1/16" className={'link'}>
                    <FontAwesomeIcon icon={faPlay} style={{color: 'white'}}/>
                    &ensp;START

                </Link>
            </div>
            <div className={'snd_choice'}>
                <Link to="/" className={'link'}>
                    <FontAwesomeIcon icon={faCogs} style={{color: 'white'}}/>
                    &ensp;SETTING
                </Link>
            </div>
        </div>
    )
};
